import './Row.css';

function Row({id, title, genre, releaseDate, hltb, timePlayed, status, score, onRowClick }) {

  return (
    <div className="row" onClick={() => onRowClick({ id, title, genre, releaseDate, hltb, timePlayed, status, score })}>
      <div className="gameInfo"> 
        <span >{title || 'Not Available'}</span>
        <span>{genre || 'Not Available'}</span>
        <span>{releaseDate}</span>
        <span>{hltb} hs</span>
        <span>{timePlayed} hs</span>
        <span>{status}</span>
      </div>
      <span className="score">{score}</span>
    </div>
  );
}

export default Row;
